                    <div>שם משימה</div>
                    <div>אישור ירידה</div>
                    {lists.map(list => 
                    (<OperationList listID={list.id} key ={list.id} cards = {list.cards}  />))}
    
                </div>
            </div>*/
            <div>
            {lists.OperationList.map(list => 
          ( <OperationList listID={list.id} key ={list.id} title = {list.title} cards = {list.cards}  />))}        

            </div>
        )
    }
}
const mapStateToProps = (state) =>{
    return {
        title: state.title
    }
}


export default connect(mapStateToProps)(MainWindow)
